import React from 'react';
import ellipsis from '../images/icon-ellipsis.svg'



class CardTime extends React.Component {
    render() {
        return (
            <div className={this.props.color + "logo"}>
                <div className="gang d-flex justify-content-end align-items-center">
                    <img className="img-fluid"  alt="" />
                </div>

                <div className="py-4 card">
                    <div className="d-flex justify-content-between">
                        <p className=" fs-5">{this.props.titre}</p>
                        <div className="">
                            <img className="bang" src={ellipsis} alt="" />
                        </div>
                    </div>
                    <div className="">
                        <p className="text-white h2"> {this.props.heure} hrs</p>
                        <p className="text-white">Last week-{this.props.week}hrs</p>
                    </div>
                </div>
            </div>



        )
    }
}


export default CardTime;
